import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="Main">
      <header id="home">
        {/* <img src={logo} className="App-logo" alt="logo" /> */}
        <nav id="nav-wrap" class="nav-wrap">
         <ul id="nav" class="nav">
            <li><a class="smoothscroll" href="#home">Home</a></li>

         </ul>
         <hr/>
      </nav> 
      </header>
    </div>
  );
}

export default App;
